class Solution:
    def maxOperations(self, s: str) -> int:
        n = len(s)
        ret = 0
        cnt_one = 0

        for i in range(n-1):
            if s[i]=='1':
                cnt_one += 1

            if s[i]=='1' and s[i+1]=='0':
                ret += cnt_one

        return ret
